==Demographics== {{As of|2001}} India [[census]],<ref>{{cite web|url=http://www.censusindia.net/results/town.php?stad=A&state5=999|archiveurl=https://web.archive.org/web/20040616075334/http://www.censusindia.net/results/town.php?stad=A&state5=999|archivedate=2004-06-16|title= Census of India 2001: Data from the 2001 Census, including cities, villages and towns (Provisional)|accessdate=2008-11-01|work= |publisher= Census Commission of India}}</ref> Aantaliya had a population of 4989. Males constitute 54% of the population and females 46%. Aantaliya has an average literacy rate of 76%, higher than the national average of 59.5%; with 59% of the males and 41% of females literate. 10% of the population is under 6 years of age.
